import { ConnectButton, DisconnectButton } from '../components/Wallet';
import { MINTER_CONTRACT_ADDRESS } from '../contracts/addresses';

function TestPage() {
    const { account } = useStarknet();

    return (

        <>
        <div className="w-full h-screen grid grid-cols-12 justify-items-center px-20 bg-black min-h-screen content-start position relative">
            <img src="dancerhome.png" className='col-span-12 w-full h-full object-cover absolute z-0' alt="" />
            <Navig />
            <div className='bg-gray-200 col-span-12 w-full grid grid-cols-12 place-content-center content-center z-10 h-screen'>
                <div className='bg-gray-300 col-span-5 w-full grid justify-content-center h-full' >
                    <img src="/img/wlogo.png" alt="" />
                </div>
                <div className='bg-gray-300 col-span-7 w-full grid justify-content-center' >
                   <h1>logo2</h1> 
                </div>
            </div>
         </div>
        </>


    );
}

export default TestPage;
